import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

var T = null;
export default class BackToTop extends React.Component {
  constructor(){
    super();
    this.state = {
      date:null
    }
  }
  componentDidMount(){
    fetch('http://localhost:8080/React_Manage2/myaction.action')
    .then((response)=> {
      return response.text();
    }).then((text)=> { 
      this.setState({
        date: text
      })
    })    
  }
  render(){
    return (
      <div>
        {this.state.date} 
        hello

      </div>
    
    )
  }
  ;
}
